import './company.css'

export default function Company() {
    const getContent = () => {
        return (
            <Switch>
                <Route path='/company/home'>
                    <CompanyHome />
                </Route>
                <Route path='/company/temp'>
                    <CompanyTemp />
                </Route>
            </Switch>
        )
    }
    return (<div className='Company'>
        {getContent()}
    </div>)
}
